,p_query_type=>'SQL'
,p_layer_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'WITH t AS (',
'    SELECT id_incidente, longitud, latitud, tiempo_inicio, tiempo_final, desde_lugar, hasta_lugar, longitud_metros, tipo_incidente',
'    FROM incidentes_coordenadas',
'    INNER JOIN incidentes',
'    ON incidentes_coordenadas.id_incidente = incidentes.id',
'    INNER JOIN incidentes_tipos',
'    ON incidentes_tipos.id = incidentes.tipo_id',
'    WHERE (:P3_TYPE_INCIDENT IS NULL OR tipo_incidente = :P3_TYPE_INCIDENT)',
'    AND ',
'        (CASE',
'            WHEN :P3_DATE_INCIDENT_FIRST IS NULL ',
'                AND TO_CHAR(tiempo_inicio, ''YYYY-MM-DD'') BETWEEN TO_CHAR(SYSDATE-7, ''YYYY-MM-DD'') AND TO_CHAR(SYSDATE-1, ''YYYY-MM-DD'')',
'                    THEN 1',
'            WHEN :P3_DATE_INCIDENT_SECOND IS NULL',
'                AND :P3_DATE_INCIDENT_FIRST IS NOT NULL',
'                AND TO_CHAR(tiempo_inicio, ''YYYY-MM-DD'') BETWEEN :P3_DATE_INCIDENT_FIRST AND TO_CHAR(SYSDATE-1, ''YYYY-MM-DD'')',
'                    THEN 1',
'            WHEN :P3_DATE_INCIDENT_FIRST IS NOT NULL AND ',
'                TO_CHAR(tiempo_inicio, ''YYYY-MM-DD'') BETWEEN :P3_DATE_INCIDENT_FIRST AND :P3_DATE_INCIDENT_SECOND',
'                    THEN 1',
'            ELSE 0',
'            END = 1',
'        )',
')',
'',
'select t.*',
'from (select t.*,',
'             row_number() over (partition by id_incidente order by id_incidente) as seqnum',
'      from t',
'     ) t',
'where seqnum = 1;'))
,p_has_spatial_index=>false
,p_pk_column=>'ID_INCIDENTE'
,p_geometry_column_data_type=>'LONLAT_COLUMNS'
,p_longitude_column=>'LONGITUD'
,p_latitude_column=>'LATITUD'
,p_point_display_type=>'SVG'
,p_point_svg_shape=>'Default'
,p_feature_clustering=>false
,p_tooltip_adv_formatting=>true
,p_tooltip_html_expr=>wwv_flow_string.join(wwv_flow_t_varchar2(
'El incidente es de tipo: &TIPO_INCIDENTE.<br>',
'y recorre desde: &DESDE_LUGAR.<br>',
'hasta: &HASTA_LUGAR.'))
,p_link_target_type=>'REDIRECT_PAGE'
,p_link_target=>'f?p=&APP_ID.:4:&SESSION.::&DEBUG.:RR,:P4_INCIDENTE_ID:&ID_INCIDENTE.'
